Are you a fan of Bleach? Install this theme and get HD wallpapers every time you open newtab.Install a new Bleach theme and get HD wallpapers from anime every time you open a new tab.

Features:
- Opening each time a new contribution, enjoy the new bright themes of Bleach;
- digital clock, weather in real time with the definition of your location;
- Convenient search engine Google;
- Quick access to your bookmarks and Gmail mail;
- Icons for quick access to social networks YouTube, Instagram, Facebook, Twitter, as well as to large online stores AliExpress, Amazon, Ebay.

